import React from 'react';
import './ChemistryWorkspace.css';

// Known items
const KNOWN_APPARATUS = {
  Beaker: {
    name: "Beaker",
    imageSrc: "/images/beaker.png",
    color: "#888"
  },
  Flask: {
    name: "Flask",
    imageSrc: "/images/flask.png",
    color: "#bbb"
  }
};

const KNOWN_CHEMICALS = {
  HCl: {
    name: "HCl",
    color: "#ff0000"
  },
  NaOH: {
    name: "NaOH",
    color: "#00ff00"
  },
  Water: {
    name: "Water",
    color: "#0000ff"
  }
};

const ChemistryWorkspace = ({ items, onSelectItem, removeItem }) => {
  // Merge items with known apparatus/chemicals
  const mergedItems = items.map((item) => {
    // 1) Figure out the best guess for this item’s name
    const userName =
      item.name ??
      item.properties?.name ??
      item.id ??
      "Unknown Apparatus";

    // 2) Check if there's a known apparatus for userName
    const knownApp = KNOWN_APPARATUS[userName];
    if (item.action === "bringApparatus" || knownApp) {
      if (knownApp) {
        // If it's known, override with known data
        item = {
          ...item,
          name: knownApp.name,
          imageSrc: knownApp.imageSrc ?? item.imageSrc,
          properties: {
            ...item.properties,
            color: knownApp.color ?? item.properties?.color
          }
        };
      } else {
        // Not known, but we keep the user-provided name
        item = {
          ...item,
          name: userName,
          imageSrc: item.imageSrc ?? "/images/placeholder.png",
          properties: {
            ...item.properties,
            color: item.properties?.color ?? "#aaa"
          }
        };
      }
    }

    // 3) Merge chemicals if present
    if (item.chemicals && Array.isArray(item.chemicals)) {
      item.chemicals = item.chemicals.map((chem) => {
        // Similarly, find the best guess for chemical name
        const userChemName = chem.name ?? chem.id ?? "Unknown Chemical";
        const knownChem = KNOWN_CHEMICALS[userChemName];
        if (knownChem) {
          return {
            ...chem,
            name: knownChem.name,
            color: knownChem.color ?? chem.color
          };
        } else {
          // Keep user-provided name if unknown
          return {
            ...chem,
            name: userChemName,
            color: chem.color ?? "#ccc"
          };
        }
      });
    }

    return item;
  });

  // Your UI EXACTLY as provided (no changes to layout or styling)
  return (
    <div className="chem-workspace">
      <div className="workspace-header">
        <h2>Chemistry Lab Workspace (Simulation Mode)</h2>
        <p>Use Previous/Next to step through the experiment.</p>
      </div>
      <div className="lab-bench">
        <div className="lab-items">
          {mergedItems.map((item) => {
            const borderColor = item.properties?.color || "#aaa";
            return (
              <div
                key={item.id}
                className="lab-item"
                onClick={() => onSelectItem(item)}
                style={{ borderColor }}
              >
                <img
                  src={item.imageSrc}
                  alt={item.name}
                  width="60"
                  height="60"
                  className="apparatus-img"
                />
                <div className="item-label">{item.name}</div>
                <div className="item-details">
                  {item.chemicals && item.chemicals.length > 0 ? (
                    <ul className="chemical-list">
                      {item.chemicals.map((chem, idx) => (
                        <li key={idx}>
                          <span className="chem-icon">⚗️</span>
                          <strong>{chem.name}</strong>
                          &nbsp;({chem.amount}{chem.unit || ""})
                        </li>
                      ))}
                    </ul>
                  ) : (
                    <div className="no-chemicals">No chemicals added yet.</div>
                  )}
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default ChemistryWorkspace;
